import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, Typography, Button, Chip } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  // demo
  const [user, setUser] = useState({ name: "Jana Nováková", credits: 150 });

  // zde načítat data uživatele z API
  useEffect(() => {
    // Zde byste načetli data uživatele...
    // setUser({ name: "Jana Nováková", credits: 150 });
  }, []);

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" style={{ flexGrow: 1 }}>
          GymNest
        </Typography>
        <Button color="inherit" component={Link} to="/">Domů</Button>
        <Button color="inherit" component={Link} to="/akce">Akce</Button>
        <Button color="inherit" component={Link} to="/clenstvi">Členství</Button>
        <Button color="inherit" component={Link} to="/rozvrhy">Rozvrhy</Button>
        {/* Zobrazení informací o uživateli a kreditech */}
        {user && (
          <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <Typography color="inherit">Vítejte, {user.name}</Typography>
            <Chip label={`Kredity: ${user.credits}`} color="secondary" />
          </div>
        )}
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
